import React, { Fragment , useState } from "react";
import Test from "./test";
import Task2 from "./components/Task2";
const App = () => {
  const mapConfig = {
    lat: 22,
    lng: -72,
    zoom: 6
  };

  const [edit , setEdit] = useState(false)

  return (
    <Fragment>
        <div id="map-wrapper">
            {
                edit ? <Test />  : <Task2  />
            }
            <button
                onClick={()=>{setEdit(!edit)}}
                style={{
                zIndex:4000000, position:'fixed',
                top:'80px',
                left:'10px',
                background:'lightGreen',
                padding:'10px 20px',
                fontFamily:'sans-serif'
            }}>Edit</button>
        </div>
    </Fragment>
  );
};

export default App;
